import styled from "styled-components";

function TodoItem({ todo }) {
  return <Container>{todo.text}</Container>;
}

const Container = styled.li`
  padding: 5px 10px;
  border-bottom: 1px solid ${({ theme }) => theme.colors.bd_color};
`;

export default TodoItem;
